import React from 'react';
import { View, Text, Button } from 'react-native';
import { createStackNavigator } from '@react-navigation/stack';
import Driving from '../pages/Driving';
import Energy from '../pages/Energy';
import Footer from '../Footer';
import Navbar from '../Navbar';

const Stack = createStackNavigator();

function TrackOptions({ navigation }) {
    return (
        <View style={{ flex: 1 }}>
            <Navbar />
            <View style={{ paddingTop: 100 }}> {/* Adjust this value as needed */}
                <Text>Choose an option:</Text>
                <Button
                    title="Driving"
                    onPress={() => navigation.navigate('Driving')}
                />
                <Button
                    title="Energy"
                    onPress={() => navigation.navigate('Energy')}
                />
            </View>
            <Footer />
        </View>
    );
}

function TrackNav() {
    return (
        <View style={{ flex: 1 }}>
            <Stack.Navigator>
                <Stack.Screen
                    name="Track"
                    component={TrackOptions}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="Driving"
                    component={Driving}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="Energy"
                    component={Energy}
                    options={{ headerShown: false }}
                />
            </Stack.Navigator>
        </View>
    );
}

export default TrackNav;
